import * as React from "react";
import { Typography, Paper, TableRow, TableHead, TableContainer, TableCell, TableBody, Table } from "@mui/material";
import { Client } from "../";
import { format } from 'date-fns';
import './ClientsTable.css';
import { useTranslation } from "react-i18next";

type Props = {
  clients: Client[];
};

const ClientsTable: React.FC<Props> = ({ clients= [] }) => {
  const { t } = useTranslation();

  return (
    <div className="client-table">
      <TableContainer component={Paper} sx={{ height: "100%" }}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>{t("clients:table.head.name")}</TableCell>
              <TableCell align="right">{t("clients:table.head.country")}</TableCell>
              <TableCell align="right">{t("clients:table.head.birthday")}</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {clients.map((client) => (
              <TableRow
                key={client.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell component="th" scope="row">
                  {client.name}
                </TableCell>
                <TableCell align="right">{client.country}</TableCell>
                {client?.birthday && (
                  <TableCell align="right">
                    {format(new Date(client.birthday), "dd/MM/yyyy")}
                  </TableCell>
                )}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Typography variant="h6" component="div" align="right">
        Bernardo Vit√≥ria
      </Typography>
    </div>
  );
};


export default ClientsTable;
